import React from 'react'
import  './loginOptions.css'

function LoginStudent() {
    return (
        <div className='container'>
          <div className='header'>EcoCup Student Login
            <div className='title'>Enter your ID and password</div>
            <input type='email' placeholder='Enter your Email'>Enter your ID</input>
            <input type='password' placeholder='Enter your password'>Enter your password</input>
            <div>Log in</div>
            <div>Back to login options</div>
            </div>
          </div>
    )
}

export default LoginStudent;
